import React, { Component } from 'react';
import ContactLink from './ContactLink'

class Contacts extends Component {

  state = {
    links: [
      {
        image: email,
        alt: "Email icon",
        link: "kennethan12@gmail.com"
      },
      {
        image: github,
        alt: "GitHub icon",
        link: "https://github.com/kennethan12"
      },
      {
        image: linkedin,
        alt: "LinkedIn icon",
        link: "https://www.linkedin.com/in/kennethan12/"
      },
      {
        image: twitter,
        alt: "Twitter icon",
        link: "https://twitter.com/kennethan12"
      }
    ]
  }

  render() {
    const { links } = this.state;

    return (
      <div class='container'>
        <div class='row'>
          {links.map((link) => {
            return (
              <ContactLink image={link.image} alt={link.alt} link={link.link} />
            )
          })}
        </div>
      </div>
    )
  }
}

export default Contacts;
